import React from "react";
import AllyGrid from "./components/AllyGrid";
import EnemyGrid from "./components/EnemyGrid";
import "./App.css";

const gridSize = 30;

function App() {
  return (
    <div className="App" style={{ display: "grid" ,gridTemplateColumns: `repeat(${gridSize})`}}>
      <AllyGrid gridSize={gridSize} />
      <EnemyGrid gridSize={gridSize} />
    </div>
  );
}

export default App;

